import React, { useState } from 'react';
import axios from 'axios';

const Register = () => {
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    password: ''
  });

  const { username, email, password } = formData;

  const onChange = e => setFormData({ ...formData, [e.target.name]: e.target.value });

  const onSubmit = async e => {
    e.preventDefault();
    try {
      const res = await axios.post('http://127.0.0.1:5000/register', formData);
      console.log(res.data);
    } catch (err) {
      console.error(err.response.data);
    }
  };

  return (
    <form onSubmit={e => onSubmit(e)}>
      <input type="text" name="username" value={username} onChange={e => onChange(e)} placeholder="Username" />
      <input type="email" name="email" value={email} onChange={e => onChange(e)} placeholder="Email" />
      <input type="password" name="password" value={password} onChange={e => onChange(e)} placeholder="Password" />
      <button type="submit">Register</button>
    </form>
  );
};

export default Register;
